import {FC} from "react";
import styled from 'styled-components';

const ErrorBox = styled.div`
margin-left:650px;
font-size: 50px;
color: gray;
`;
const Eroor = styled.img`
width:400px;
position: absolute;
margin-top:200px;
margin-right:100px;
`;


const PageNotFound: FC = () =>{
    return(
        <ErrorBox>
           <Eroor src="/media/icons/error.png" alt=""/>dsad
        </ErrorBox>
    )
}
export default PageNotFound;
